import React, { useState } from 'react';

export default function InputPanel() {
  const [hazard, setHazard] = useState('');
  const [risk, setRisk] = useState('');
  const [report, setReport] = useState('');
  const [detailedReport, setDetailedReport] = useState('');
  const [relatedCases, setRelatedCases] = useState([]);

  const handleSubmit = async () => {
    const response = await fetch('http://localhost:5000/api/report', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({ hazard, risk })
    });
    const data = await response.json();
    setReport(data.result);
    setDetailedReport('');
    setRelatedCases(data.relatedCases || []);
  };

  const handleDetailedReport = async () => {
    const response = await fetch('http://localhost:5000/api/report', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({ hazard, risk, detailed: true })
    });
    const data = await response.json();
    setDetailedReport(data.result);
  };

  return (
    <div>
      <h2>労災リスク報告書ツール</h2>

      <label>洗い出し内容（例：コンベヤーがある現場など）：</label><br />
      <input type="text" value={hazard} onChange={e => setHazard(e.target.value)} /><br /><br />

      <label>危険状況（例：挟まれ、転倒など）：</label><br />
      <input type="text" value={risk} onChange={e => setRisk(e.target.value)} /><br /><br />

      <button onClick={handleSubmit}>報告書を作成する</button><br /><br />

      {relatedCases.length > 0 && (
        <div style={{ background: '#f0f0f0', padding: '1em' }}>
          <h4>参考になりそうな事例</h4>
          {relatedCases.map((c, idx) => (
            <div key={idx}>
              <strong>タイトル:</strong> {c['タイトル']}<br />
              <strong>発生状況:</strong> {c['発生状況']}<br />
              <strong>対策:</strong> {c['対策']}<br /><br />
            </div>
          ))}
        </div>
      )}

      {report && (
        <div>
          <h4>生成されたレポート</h4>
          <pre style={{ whiteSpace: 'pre-wrap' }}>{report}</pre>
          <button onClick={handleDetailedReport}>④ 改善提案（詳細版）</button>
        </div>
      )}

      {detailedReport && (
        <div>
          <h4>詳細版レポート</h4>
          <pre style={{ whiteSpace: 'pre-wrap', color: 'darkblue' }}>{detailedReport}</pre>
        </div>
      )}
    </div>
  );
}
